    false,nt"url": null,nt"notes": "The Satellite View of Hawaii, with Shaded
    Relief map layer is a 200- meter-resolution simulated-natural-color image of Hawaii.
    Vegetation is generally green, with forests in darker green and grasslands or pasture
    in lighter green. Areas of volcanic rock and soil are represented by shades of brown.
    The image was produced by combining Landsat Thematic Mapper(TM) imagery from the
    Landsat 4 and Landsat 5 satellites with relief enhanced by shading.",nt"license_title":
